6415	\N	POST /api/doctors/visits/22/diagnosis-notes	doctors	0	{"notes":{"chiefComplaint":"Patient presents with severe, throbbing headache that started 3 days ago. The pain is localized to the right temporal region and is described as 8/10 on pain scale. Associated symptoms include photophobia, phonophobia, and nausea. Patient reports difficulty concentrating and has been unable to work since onset.","historyOfPresentIllness":"Headache began suddenly while patient was working at computer. Initially mild (3/10) but progressively worsened over 24 hours to current severity. Patient tried over-the-counter analgesics (ibuprofen, acetaminophen) with minimal relief. No recent head trauma, fever, or neck stiffness. Patient reports similar episodes in past but less severe and shorter duration.","pastMedicalHistory":"Migraine with aura diagnosed at age 16, well-controlled with sumatriptan until 6 months ago. Hypertension diagnosed 2 years ago, currently on lisinopril 10mg daily. No known surgeries. Family history significant for maternal migraine and paternal hypertension.","allergicHistory":"Penicillin allergy - causes severe rash and difficulty breathing. No other known drug allergies. Patient reports mild seasonal allergies to pollen.","physicalExamination":"Vital signs: BP 150/95 mmHg, HR 88 bpm, RR 18/min, Temp 98.6F. General: Alert, oriented x3, appears uncomfortable due to headache. Neurological: No focal deficits, pupils equal and reactive to light, extraocular movements intact, no nystagmus. Neck supple, no meningeal signs. Cardiovascular: Regular rate and rhythm, no murmurs.","investigationFindings":"CT head without contrast: Normal brain parenchyma, no acute intracranial abnormalities, no mass lesions or hemorrhage. Blood pressure elevated at 150/95. CBC and basic metabolic panel within normal limits. No signs of secondary headache causes.","assessmentAndDiagnosis":"Migraine with aura, likely triggered by stress and uncontrolled hypertension. Secondary headache ruled out by normal imaging. Current episode represents exacerbation of known migraine condition with possible medication overuse contributing to increased frequency.","treatmentPlan":"1. Acute migraine management with sumatriptan 50mg PRN, max 2 doses per day. 2. Optimize blood pressure control - increase lisinopril to 20mg daily. 3. Migraine prophylaxis - consider propranolol 40mg BID. 4. Lifestyle modifications including stress management, regular sleep schedule, and trigger avoidance. 5. Follow up in 2 weeks to assess response.","treatmentGiven":"Sumatriptan 50mg tablet administered in office with good response. Patient counseled on proper medication use and trigger identification. Blood pressure medication adjusted.","medicationIssued":"Sumatriptan 50mg tablets x6, Lisinopril 20mg tablets x30, Propranolol 40mg tablets x60","additional":"Patient educated on migraine triggers including stress, irregular sleep, certain foods (chocolate, aged cheese), and hormonal changes. Advised to keep headache diary. Patient counseled on importance of blood pressure control in migraine management.","prognosis":"Good prognosis with appropriate medication management and lifestyle modifications. Patient should see improvement in headache frequency and intensity with optimized blood pressure control and migraine prophylaxis. Regular follow-up recommended to monitor response and adjust treatment as needed."}}	127.0.0.1	axios/1.12.2	2025-10-16 18:38:00.154
